import React from 'react'
import MyDate from './MyDate'

export default function LogItem() {
  return (
    <div className='item'>
      <MyDate></MyDate>
      {/* 最外层容器 */}
      <div>
        {/* 日期容器 */}
        <div className='date'>
          <div className='month'>四月</div>
          <div className='day'>19</div>
        </div>
      </div>
    </div>
  )
}
